import React from 'react'
import TabViews from '../components/TabViews/index'
import globalMessages from '../messages';

export default {
  title: 'Tab Views',
  component: TabViews
}

export function TabViewsContainer() {

  const tabview = [
    <Tab1/>,
    <Tab2/>,
    <Tab3/>,
    <Tab4/>,
    <Tab5/>
  ]

  const props = {
    currentTabValue: 0,
    tabChange: () => {},
    data: {},
    tabValues: [],
    indexChange: () => {},
    tabViews: {tabview},
  };



  return (
    <div> 
      <h3>Example Tab</h3>
      <TabViews {...props}/>
    </div>
  )
}
